        "fct-descr": "\u003cp\u003eUsed to derive instances of the \u003ccode\u003e\u003ca\u003eTypeable\u003c/a\u003e\u003c/code\u003e classes from the \u003ccode\u003e\u003ca\u003eMeta\u003c/a\u003e\u003c/code\u003e classes.\n Requires the ScopedTypeVariables language option.\n\u003c/p\u003e\u003cpre\u003e import Data.Type\n import Data.Type.Typeable\n\n data T (m :: * -\u003e *) a = ...\n deriveMeta ''T\n deriveTypeableFromMeta ''T\n\u003c/pre\u003e\u003cp\u003eYields a \u003ccode\u003e\u003ca\u003eTypeable\u003c/a\u003e\u003c/code\u003e instance like:\n\u003c/p\u003e\u003cpre\u003e instance (MetaX m) =\u003e Typeable1 (T m) where\n   ...\n\u003c/pre\u003e\u003cp\u003eThe template haskell funtions in this module expect to find symbols exported from \u003ccode\u003eData.Type\u003c/code\u003e module under \u003ccode\u003eData.Type\u003c/code\u003e. Thus change:\n\u003c/p\u003e\u003cpre\u003e import qualified Data.Type as T\n\u003c/pre\u003e\u003cp\u003eInto:\n\u003c/p\u003e\u003cpre\u003e import qualified Data.Type\n import qualified Data.Type as T\n\u003c/pre\u003e\u003cp\u003eIt would be possible to drop this requirement, but currently not without bloating the library unnecessarily.\n\u003c/p\u003e",
